// flex-wrap: wrap;
// gap: 15px;
// width: 100%;
// height: 100vh;
//   @media only screen and (max-width: 768px) {
//     margin-top: 50px;
//   }
// `;
const Span = styled.span`
  @media only screen and (max-width: 768px) {
    width: 100%;
    display: flex;
    height: 50px;
    background-color: #00652e;
  }
`;

function Home() {
  return (
    <>
      <Burger />
      <Span />
      <Container/>
    </>
  );
}
export default Home;
